import React from "react";

class Item extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      name: props.name,
      description: props.description,
      menuId: props.menuId,
      cost: props.decimal,
      calories: props.calories,
    };
  }

  render() {
    return (
      <div>
        <h1>My Car</h1>
      </div>
    );
  }
}

export default Item;
